import React from "react";

const Project = ({query, err}) => {
    return(
        
    <Query
    query={GET_PROJECT}
    >
    {({ loading, error, data }) => {
      if (loading) return <p>Loading...</p>;
      if (error) return <p>Error :(</p>;

      return data.getProject.map(({ id, name, url }) => (
        <div key={id}>
          <p>
            {id}: {name}: {url}
          </p>
        </div>
      ));
    }}
  </Query>
    );
}
export default Project;
